import React from "react";
import Searchbox from "./Searchbox";

function Button(props) {
    return (
        <button onClick={props.onClick}>
            {props.children}
        </button>
    )
};

export default function SWGallery(imgList) {
    return (
        <div style={{border: "2px solid gray", borderRadius: "25px", padding: "20px", width: "200px", height: "150px"}}>
            <Searchbox placeHolder={"Enter one of the following: films, people, planets, species, starships, vehicles"} style={{boxSizing: "border-box"}}/>
        </div>
    )
};
